(21, 'Indian government set to ban cryptocurrencies', 'Cryptocurrency and Regulation of Official Digital Currency Bill that will be introduced in its winter session.\r\n\r\nThe planned legislation aims \"to create a facilitative framework for the creation of the official digital currency to be issued by the Reserve Bank of India (RBI)\".\r\n\r\nThe plan to prohibit all private cryptocurrencies appeared to be essentially the same as an earlier draft of the bill submitted in January.\r\nCryptocurrency and Regulation of Official Digital Currency Bill that will be introduced in its winter session.\r\n\r\nThe planned legislation aims \"to create a facilitative framework for the creation of the official digital currency to be issued by the Reserve Bank of India (RBI)\".\r\n\r\nThe plan to prohibit all private cryptocurrencies appeared to be essentially the same as an earlier draft of the bill submitted in January.\r\nCryptocurrency and Regulation of Official Digital Currency Bill that will be introduced in its winter session.\r\n\r\nThe planned legislation aims \"to create a facilitative framework for the creation of the official digital currency to be issued by the Reserve Bank of India (RBI)\".\r\n\r\nThe plan to prohibit all private cryptocurrencies appeared to be essentially the same as an earlier draft of the bill submitted in January.', 5, 6, '0', NULL, '2021-11-26 08:15:55'),
(22, 'Why Elon Musk Fired His Long-Term Assistant Who Asked for A Raise', 't’s early 2014 — the time when Mary Beth Brown decided to ask for a raise but never thought that it would put an end to her 12-year long professional relationship with Elon Musk.\r\nBrown had been working for the modern-day Tony Stark Elon Musk for 12 years. She worked really hard as she would travel back and forth between Los Angeles and Silicon Valley every week, work late at night, and even on the weekends.\r\nShe used to handle Musk’s scheduling across two companies (SpaceX and Tesla), manage public relations, and often help Musk make business decisions.t’s early 2014 — the time when Mary Beth Brown decided to ask for a raise but never thought that it would put an end to her 12-year long professional relationship with Elon Musk.\r\nBrown had been working for the modern-day Tony Stark Elon Musk for 12 years. She worked really hard as she would travel back and forth between Los Angeles and Silicon Valley every week, work late at night, and even on the weekends.\r\nShe used to handle Musk’s scheduling across two companies (SpaceX and Tesla), manage public relations, and often help Musk make business decisions.', 6, 2, '0', NULL, '2021-11-26 10:54:53'),
(23, 'Seven Psychological Reasons to Become an Entrepreneur', 'The psychology of entrepreneurship is complex and paradoxical. It depicts many factors related to entrepreneurs’ personality, physical health, mental health, mindset, emotional traits, spiritual connections, culture, lifestyle choices, and worldviews.\r\nSome entrepreneurs identify these psychological feelings at a very young age. They build their lives and careers by leveraging the power of these psychological constructs. However, some of us find out these desires after having many setbacks and experiencing hardships at work. For example, I had entrepreneurial dreams and aspirations in my teenage years but only had an opportunity to take action after the age of 45.\r\nInterestingly, I developed my entrepreneurship interest and started the journey after mentoring and being mentored by some entrepreneurs in technology leadership. They inspired and encouraged me more than my theoretical knowledge in the field. Their achievements became the primary source of inspiration and confidence for me to get started on this journey.\r\nEven though my theoretical learning from the body of knowledge helped to some extent, the more significant value was in experiential studies and ethnographic research. These types of studies allowed me to become a member of business organizations and observe the dynamics methodically. Observing and being an observer simultaneously added an extra dimension to my studies.\r\nMy formal education, even in business and leadership, contributed very little to get me started, even though they slightly increased my self-confidence. However, my experiences and interactions with entrepreneurs played a significant role in pushing my ideas in this exciting journey.\r\nDuring my leadership studies, I observed the behaviour of many entrepreneurs. Some distinguished leaders I met depicted significant entrepreneurship traits, and some exceptional leaders only had a few characteristics of entrepreneurs. So not all leaders had a chance to manifest their entrepreneurial dreams even though they influence many people to move in a direction.', 6, 5, '0', NULL, '2021-11-26 10:55:52'),
