(28, 'Four Minutes (A Philosophical Tribute to Maradona)', 'It was the end of November 2020. England was counting days before the second national lockdown would finish. Crystal Palace were playing Newcastle at Selhurst Park in South London.\r\n“I can’t believe we are in,” Edo said as players were warming up, showered with the light of reflectors, listening to their own echo circulating around the empty stadium. Sweat was dripping from players’ foreheads, turning into steam on that cold Friday evening. Instead of fans, the stands were filled with huge advert posters, Crystal Palace’s coats of arms and empowering messages such as ‘Black Lives Metter’. In the first rows of the stand on the opposite side of the pitch, club’s staff were placed while a few rows above the rare representatives of media who managed to get accreditation were located.\r\n“I told you, man, no lockdown can stop me from watching football today!” Aksel said. This one is for Maradona!”\r\n“Right, for Maradona!”\r\n“These are very strange circumstances, though… football with no fans… Who would figure.”\r\n“The whole world is very strange at the moment,” Edo said. “Football just mirrors everything else.”\r\n“World is a very strange place at the moment, indeed.”\r\nThe game started with a minute of silence for Diego Maradona, who passed away two days earlier.\r\n“Stop it, you idiot. They will see us,” Aksel said when Edo started clapping along with the players who gathered in the centre circle of the pitch to give honour to Maradona. They all had some peculiar facial expression like part of them died alongside Maradona, one would imagine. Part of their passion, part of their dreams. Part of their life.\r\n“Sorry, man,” Edo whispered. I thought I was doing the right thing.”\r\n“Maradona was a great man,” Aksel said when a referee blew the whistle for the match to begin. “But he was a mad man also.”\r\n“”No great mind has ever existed without a touch of madness”, Aristotle once said,” Edo quoted the ancient philosopher. “You can’t be the greatest if you don’t carry a burden of insanity upon you.”\r\n“Oh, I think philosophers are a waste of space. What is their purpose,” Aksel asked rhetorically.\r\n“Maradona had it all,” Edo said quietly, feeling as he would offend football Gods if he said it louder.\r\n“Yeah, his skills were one of a kind, really,” Aksel said. “He could dribble anybody anywhere with anything — football, tennis ball or an orange.”\r\n“He could, but I am not talking about his footballing skills,” Edo said. “He had it all as in he was blessed and cursed at the same time. He had everything life had to offer. Both good and bad. I mean, we all carry good and bad in us. But he carried extremes. He had something very close to absolute good and something very close to absolute bad. He carried God and Satan at the same time.”\r\n“If being cursed means having a wild nightlife and a bunch of ladies, then I want to be cursed as well.”\r\n“Don’t be that shallow. He suffered greatly.”\r\n“I apologise,” Aksel said and took two cans of beer out of his jumper’s pocket.\r\n“Diego Maradona had been given the ability to create, and the ball was his instrument to express himself.”\r\n“So, why did he suffer?” Aksel asked and gave one can to Edo.\r\n“Fernando Signorini, Maradona’s personal trainer who had a huge influence on his development, once said: “At one point I learned there was Diego and there was Maradona. Diego was a kid with insecurities from Villa Fiorito. A wonderful boy. On the other hand, Maradona was a character he had to come up with in order to face the demands of the football business and the media. Maradona couldn’t show any weakness.”” Edo quoted Maradona’s trainer.', 6, 5, '0', NULL, '2021-11-26 11:00:52'),
