(34, 'Facebook whistleblower Frances Haugen to testify before Congress for a second time', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif; font-size: 23.9999px;&quot;&gt;The House committee hearing is focused on holding big tech accountable.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;speakableTextP1&quot; style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 20px; line-height: 30px; color: rgb(0, 0, 0); font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif;&quot;&gt;Facebook whistleblower&amp;nbsp;&lt;a href=&quot;https://energycommerce.house.gov/committee-activity/hearings/hearing-on-holding-big-tech-accountable-targeted-reforms-to-techs-legal&quot; rel=&quot;noopener noreferrer nofollow&quot; target=&quot;_blank&quot; data-component=&quot;externalLink&quot; style=&quot;transition-property: all; transition-duration: 0.2s; transition-timing-function: ease; cursor: pointer; color: rgb(0, 0, 0); box-shadow: rgb(255, 255, 255) 0px 0px 0px 0px inset, rgb(184, 0, 0) 0px -1px 0px 0px inset;&quot;&gt;Frances Haugen will testify before Congress for a second time&lt;/a&gt;. Haugen will appear Wednesday at a hearing to deliberate possible changes to&amp;nbsp;&lt;span class=&quot;link&quot; section=&quot;shortcodeLink&quot;&gt;&lt;a href=&quot;https://www.cnet.com/news/section-230-how-it-shields-facebook-and-why-congress-wants-changes/&quot; style=&quot;transition-property: all; transition-duration: 0.2s; transition-timing-function: ease; cursor: pointer; color: rgb(0, 0, 0); box-shadow: rgb(255, 255, 255) 0px 0px 0px 0px inset, rgb(184, 0, 0) 0px -1px 0px 0px inset;&quot;&gt;Section 230, a key internet law&lt;/a&gt;&lt;/span&gt;&amp;nbsp;that protects social media companies from lawsuits over content that users post.&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;speakableTextP2&quot; style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 20px; line-height: 30px; color: rgb(0, 0, 0); font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif;&quot;&gt;&lt;img src=&quot;data:image/svg+xml;base64,&quot; data-filename=&quot;undraw_quitting_time_dm-8-t.svg&quot; style=&quot;width: 100%;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;div class=&quot;c-reengageNewsletter shortcode hasNewsletter newsletter-subscribe-form desktop&quot; data-track=&quot;reengageNewsletter-mapped&quot; data-component=&quot;newsletterAndInterest&quot; data-newsletter-and-interest-options=&quot;{&amp;quot;id&amp;quot;:&amp;quot;7bccd49e-819e-4822-a96e-0c2850b2d036_CNET_CAT_TOPIC&amp;quot;,&amp;quot;name&amp;quot;:&amp;quot;Politics&amp;quot;,&amp;quot;type&amp;quot;:&amp;quot;specific&amp;quot;}&quot; style=&quot;border-top: 1px solid rgb(216, 216, 216); border-bottom: 1px solid rgb(216, 216, 216); padding: 40px 0px; margin: 0px 0px 30px; zoom: 1; display: inline-block; width: 756px; color: rgb(0, 0, 0); font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif; font-size: 17px;&quot;&gt;&lt;/div&gt;&lt;p class=&quot;speakableTextP2&quot; style=&quot;font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 20px; line-height: 30px; color: rgb(0, 0, 0);&quot;&gt;The hearing, titled &quot;Holding Big Tech Accountable: Targeted Reforms to Tech&#039;s Legal Immunity,&quot; will take place under the auspices of the technology subcommittee of the House Committee on Energy and Commerce. Also testifying will be Color of Change president Rashad Robinson and Common Sense Media CEO James Steyer.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 20px; line-height: 30px; color: rgb(0, 0, 0);&quot;&gt;Haugen, a former Facebook product manager, first testified before the Senate Commerce Committee in October after she&amp;nbsp;&lt;a href=&quot;https://www.cnet.com/tech/services-and-software/facebook-whistleblower-reveals-herself-says-company-prioritizes-its-own-interests/&quot; style=&quot;color: rgb(0, 0, 0); transition-property: all; transition-duration: 0.2s; transition-timing-function: ease; cursor: pointer; box-shadow: rgb(255, 255, 255) 0px 0px 0px 0px inset, rgb(184, 0, 0) 0px -1px 0px 0px inset;&quot;&gt;leaked thousands of internal documents about the company&lt;/a&gt;&amp;nbsp;to The Wall Street Journal. Haugen urged US lawmakers to provide more active oversight of the social network, contending that Facebook&#039;s platforms&amp;nbsp;&lt;a href=&quot;https://www.cnet.com/news/facebook-whistleblower-details-moral-bankruptcy-to-congress/&quot; style=&quot;color: rgb(0, 0, 0); transition-property: all; transition-duration: 0.2s; transition-timing-function: ease; cursor: pointer; box-shadow: rgb(255, 255, 255) 0px 0px 0px 0px inset, rgb(184, 0, 0) 0px -1px 0px 0px inset;&quot;&gt;&quot;harm children, stoke division and weaken our democracy&lt;/a&gt;.&quot;&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Proxima Nova&amp;quot;, sans-serif; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 20px; line-height: 30px; color: rgb(0, 0, 0);&quot;&gt;Facebook,&amp;nbsp;&lt;span class=&quot;link&quot; section=&quot;shortcodeLink&quot;&gt;&lt;a href=&quot;https://www.cnet.com/tech/services-and-software/facebook-to-meta-a-new-name-but-the-same-old-problems/&quot; style=&quot;color: rgb(0, 0, 0); transition-property: all; transition-duration: 0.2s; transition-timing-function: ease; cursor: pointer; box-shadow: rgb(255, 255, 255) 0px 0px 0px 0px inset, rgb(184, 0, 0) 0px -1px 0px 0px inset;&quot;&gt;now known as Meta&lt;/a&gt;&lt;/span&gt;, has denied the accusations, noting that it has more than 40,000 people working on safety and security. About 3.58 billion people use Facebook and its services every month.&lt;/p&gt;', 4, 3, '0', NULL, '2021-11-30 12:36:55');

